    "metadataId": "Microsoft Managed Control 1041",
    "category": "Access Control",
    "title": "Least Privilege | Privilege Levels For Code Execution",
    "owner": "Microsoft Azure Security, Service Engineer Operations, Program Manager",
    "description": "The information system prevents any software except software explicitly documented from executing at higher privilege levels than users executing the software.",
    "requirements": "Software execution at a higher privilege level than users executing the software is not applicable for servers and network devices. Microsoft Azure only permits administrator access to server who by default have code execution privileges. Access to tools are only accessible by Microsoft Azure administrators; therefore, no read-only access is provided. These administrators have full access to the system, preventing users being indirectly provided greater privileges than assigned by Microsoft.",
